import React, { Component } from 'react'
import {ListGroup} from "react-bootstrap"

class Profile extends Component {

    constructor(props){
        super(props)
            this.state = {
                valRangeDistance: 0,
                valRangeAge: 0
            }
    }

    handleChange = (event) => {
        this.setState({
            [event.target.name] : event.target.value
        })
    }

    render() {

        return (

            <>
            
            <ListGroup className="w-25 p-3 ms-auto">

                
                <p className="ms-auto"> הגדרות גילוי </p>
                
                <ListGroup.Item>
                    <p className="ms-auto">העדפות מרחק</p>
                    <label for="customRange3" class="form-label"></label>
                    <input type="range" name="valRangeDistance" class="form-range" min="0" max="161" step="1" id="customRange3"></input>
                    <span class="text-right">{this.state.valRangeDistance + ""}</span>
                </ListGroup.Item>

                <ListGroup.Item>
                     אני רוצה להכיר
                </ListGroup.Item>

                <ListGroup.Item >
                    העדפות גיל
                    <label for="customRange3" class="form-label"></label>
                    <input type="range" name="valRangeAge" class="form-range" min="18" max="120" step="1" id="customRange3" onChange={this.handleChange}></input>
                </ListGroup.Item>

            </ListGroup>,

            </>


        )
    }
}

export default Profile
